import{_ as t,o,c as a,z as e,a as r}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 16.1-121 Order after hearing.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-121.md","filePath":"vacode/16.1-121.md"}'),s={name:"vacode/16.1-121.md"},n=e("h1",{id:"§-16-1-121-order-after-hearing",tabindex:"-1"},[r("§ 16.1-121 Order after hearing. "),e("a",{class:"header-anchor",href:"#§-16-1-121-order-after-hearing","aria-label":'Permalink to "§ 16.1-121 Order after hearing."'},"​")],-1),h=e("p",null,"After hearing the parties or such of them as may attend after being summoned, and such witnesses as may be introduced by either party, the judge shall order the officer, or the possessor of any money or other personal estate, to deliver the same to the claimant, if he be of opinion that the same belongs to the claimant; but if he be of opinion that the property, money or other personal estate, or any part thereof, belongs to the person against whom the execution or warrant of distress issued, he shall order the officer who levied on the same to sell the property so liable, to satisfy the execution or warrant of distress; or when there is money or other personal estate in the possession of a bailee or garnishee, he shall order the bailee or garnishee, as the case may be, to make delivery to the execution creditor of all such money or other personal estate so found to belong to the execution debtor, or so much thereof as may be necessary to satisfy the execution; and he may give such judgment respecting the property, the expense of keeping it, any injury done by it, and for the costs, as may be just and equitable among the parties.",-1),i=e("p",null,"1956, c. 555.",-1),d=[n,h,i];function c(l,f,p,m,u,y){return o(),a("div",null,d)}const g=t(s,[["render",c]]);export{b as __pageData,g as default};
